import React from 'react'
import { FaInfo } from 'react-icons/fa'

 const ModalRegister = ({show,info}) => {
     if (!show) {
         return null
     }
    return (
        <div className="modal">
           <div className="modal-content">
               <div className="modal-header">
                   <div className="modal-body">
                      {info.f}
                   </div>
               </div>
           </div>
        </div>
    )
}
export default ModalRegister
